import React from "react";
import GenderCardStyle from "./GenderCardStyled";

const GenderCard = (props) =>
{
  //const { gender } = props;
  console.log(props.gender);

  if(props.gender.length > 0){
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            ES LA PROP {props.gender[0].name} {props.gender[0].gender}
          </h1>
        </div>
      </GenderCardStyle>
    )

  }else{
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            NADA
          </h1>
        </div>
      </GenderCardStyle>
    )
    }
  };

export default GenderCard;
